import React, { useState } from 'react';
import { motion, useMotionValue, useSpring, useTransform } from 'framer-motion';
import { Brain, Database, Code, Cloud, BarChart3, Zap } from 'lucide-react';

const Skills: React.FC = () => {
  const [activeCategory, setActiveCategory] = useState('all');

  const skillCategories = [
    {
      title: 'Machine Learning',
      icon: Brain,
      skills: [
        { name: 'TensorFlow', level: 90 },
        { name: 'PyTorch', level: 85 },
        { name: 'Scikit-learn', level: 95 },
        { name: 'Keras', level: 80 },
        { name: 'OpenCV', level: 85 },
        { name: 'NLTK', level: 75 },
      ]
    },
    {
      title: 'Data Science',
      icon: BarChart3,
      skills: [
        { name: 'Pandas', level: 95 },
        { name: 'NumPy', level: 90 },
        { name: 'Matplotlib', level: 85 },
        { name: 'Seaborn', level: 80 },
        { name: 'Jupyter', level: 95 },
        { name: 'Tableau', level: 70 },
      ]
    },
    {
      title: 'Programming',
      icon: Code,
      skills: [
        { name: 'Python', level: 95 },
        { name: 'R', level: 80 },
        { name: 'SQL', level: 85 },
        { name: 'JavaScript', level: 70 },
        { name: 'Java', level: 65 },
        { name: 'C++', level: 60 },
      ]
    },
    {
      title: 'Data Engineering',
      icon: Database,
      skills: [
        { name: 'Apache Spark', level: 80 },
        { name: 'Hadoop', level: 75 },
        { name: 'Kafka', level: 70 },
        { name: 'Airflow', level: 75 },
        { name: 'MongoDB', level: 80 },
        { name: 'PostgreSQL', level: 85 },
      ]
    },
    {
      title: 'Cloud & DevOps',
      icon: Cloud,
      skills: [
        { name: 'AWS', level: 85 },
        { name: 'Docker', level: 80 },
        { name: 'Kubernetes', level: 70 },
        { name: 'MLflow', level: 75 },
        { name: 'Git', level: 90 },
        { name: 'CI/CD', level: 75 },
      ]
    },
    {
      title: 'MLOps',
      icon: Zap,
      skills: [
        { name: 'Model Deployment', level: 85 },
        { name: 'A/B Testing', level: 80 },
        { name: 'Monitoring', level: 75 },
        { name: 'Feature Stores', level: 70 },
        { name: 'Model Versioning', level: 80 },
        { name: 'AutoML', level: 75 },
      ]
    }
  ];

  const AnimatedSkillBar = ({ skill, index }: { skill: any; index: number }) => {
    const [isHovered, setIsHovered] = useState(false);
    const mouseX = useMotionValue(0);
    const mouseY = useMotionValue(0);

    const rotateX = useSpring(useTransform(mouseY, [-0.5, 0.5], [15, -15]), {
      damping: 25,
      stiffness: 700,
    });
    const rotateY = useSpring(useTransform(mouseX, [-0.5, 0.5], [-15, 15]), {
      damping: 25,
      stiffness: 700,
    });

    const handleMouseMove = (e: React.MouseEvent) => {
      const rect = e.currentTarget.getBoundingClientRect();
      const centerX = rect.left + rect.width / 2;
      const centerY = rect.top + rect.height / 2;

      mouseX.set((e.clientX - centerX) / (rect.width / 2));
      mouseY.set((e.clientY - centerY) / (rect.height / 2));
    };

    return (
      <motion.div
        key={skill.name}
        initial={{ opacity: 0, x: -20 }}
        whileInView={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.4, delay: index * 0.05 }}
        viewport={{ once: true }}
        onMouseMove={handleMouseMove}
        onMouseEnter={() => setIsHovered(true)}
        onMouseLeave={() => setIsHovered(false)}
        whileHover={{ 
          scale: 1.02,
          transition: { type: "spring", stiffness: 300 }
        }}
        style={{
          rotateX: isHovered ? rotateX : 0,
          rotateY: isHovered ? rotateY : 0,
          transformStyle: "preserve-3d",
        }}
        className="relative group"
      >
        <div className="flex justify-between items-center mb-2">
          <span className="text-sm font-medium text-secondary-700 group-hover:text-primary-600 transition-colors duration-200">
            {skill.name}
          </span>
          <motion.span 
            className="text-sm text-primary-600 font-semibold"
            animate={{ scale: isHovered ? 1.1 : 1 }}
            transition={{ type: "spring", stiffness: 300 }}
          >
            {skill.level}%
          </motion.span>
        </div>
        <div className="relative w-full bg-secondary-200 rounded-full h-2 overflow-hidden">
          <motion.div
            initial={{ width: 0 }}
            whileInView={{ width: `${skill.level}%` }}
            transition={{ duration: 1, delay: index * 0.1 }}
            viewport={{ once: true }}
            className="relative h-2 rounded-full"
            style={{
              background: `linear-gradient(90deg, 
                hsl(${200 + skill.level * 0.6}, 70%, 60%) 0%, 
                hsl(${250 + skill.level * 0.4}, 70%, 60%) 100%)`
            }}
          >
            <motion.div
              className="absolute inset-0 bg-white/30"
              animate={{
                x: isHovered ? ["0%", "100%"] : "0%",
              }}
              transition={{
                duration: 1,
                repeat: isHovered ? Infinity : 0,
                ease: "linear"
              }}
            />
          </motion.div>
        </div>
      </motion.div>
    );
  };

  return (
    <section id="skills" className="section-padding bg-secondary-50 relative overflow-hidden">
      {/* Animated Background Elements */}
      <div className="absolute inset-0 overflow-hidden">
        <motion.div
          className="absolute top-10 left-10 w-20 h-20 bg-primary-200 rounded-full opacity-20"
          animate={{
            x: [0, 100, 0],
            y: [0, -50, 0],
            rotate: [0, 180, 360],
          }}
          transition={{
            duration: 20,
            repeat: Infinity,
            ease: "linear"
          }}
        />
        <motion.div
          className="absolute bottom-10 right-10 w-16 h-16 bg-accent-200 rounded-full opacity-20"
          animate={{
            x: [0, -80, 0],
            y: [0, 60, 0],
            rotate: [360, 180, 0],
          }}
          transition={{
            duration: 15,
            repeat: Infinity,
            ease: "linear"
          }}
        />
      </div>

      <div className="max-w-7xl mx-auto relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold gradient-text mb-4">Skills & Expertise</h2>
          <p className="text-lg text-secondary-600 max-w-2xl mx-auto">
            Comprehensive technical skills across the entire machine learning and data science stack
          </p>
        </motion.div>

        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {skillCategories.map((category, categoryIndex) => (
            <motion.div
              key={category.title}
              initial={{ opacity: 0, y: 30, rotateX: -15 }}
              whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
              transition={{ duration: 0.6, delay: categoryIndex * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ 
                y: -5,
                rotateY: 2,
                transition: { type: "spring", stiffness: 300 }
              }}
              className="card group relative overflow-hidden"
              style={{ transformStyle: "preserve-3d" }}
            >
              {/* Hover Background Effect */}
              <motion.div
                className="absolute inset-0 bg-gradient-to-br from-primary-50 to-accent-50 opacity-0 group-hover:opacity-100 transition-opacity duration-300"
                initial={{ scale: 0.8 }}
                whileHover={{ scale: 1.1 }}
                transition={{ duration: 0.3 }}
              />

              <div className="relative z-10">
                <div className="flex items-center space-x-3 mb-6">
                  <motion.div 
                    className="p-2 bg-primary-100 rounded-lg group-hover:bg-primary-200 transition-colors duration-200"
                    whileHover={{ 
                      rotate: 360,
                      scale: 1.1,
                      transition: { duration: 0.5 }
                    }}
                  >
                    <category.icon size={24} className="text-primary-600" />
                  </motion.div>
                  <h3 className="text-xl font-bold text-secondary-900 group-hover:text-primary-700 transition-colors duration-200">
                    {category.title}
                  </h3>
                </div>

                <div className="space-y-4">
                  {category.skills.map((skill, skillIndex) => (
                    <AnimatedSkillBar 
                      key={skill.name} 
                      skill={skill} 
                      index={skillIndex} 
                    />
                  ))}
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Additional Skills with 3D effects */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="mt-16 text-center"
        >
          <h3 className="text-2xl font-bold text-secondary-900 mb-6">Additional Skills</h3>
          <div className="flex flex-wrap justify-center gap-3">
            {[
              'Deep Learning', 'Computer Vision', 'Natural Language Processing', 'Reinforcement Learning',
              'Time Series Analysis', 'Statistical Modeling', 'Data Visualization', 'Big Data Processing',
              'Model Optimization', 'Neural Networks', 'Ensemble Methods', 'Feature Engineering',
              'Hyperparameter Tuning', 'Cross-validation', 'Data Preprocessing', 'Model Interpretability'
            ].map((skill, index) => (
              <motion.span
                key={skill}
                initial={{ opacity: 0, scale: 0.8, rotateY: -90 }}
                whileInView={{ opacity: 1, scale: 1, rotateY: 0 }}
                transition={{ duration: 0.5, delay: index * 0.05 }}
                viewport={{ once: true }}
                whileHover={{ 
                  scale: 1.1,
                  rotateY: 10,
                  y: -2,
                  boxShadow: "0 10px 25px rgba(59, 130, 246, 0.3)"
                }}
                className="px-4 py-2 bg-white border border-secondary-200 rounded-full text-sm font-medium text-secondary-700 hover:border-primary-300 hover:text-primary-600 transition-all duration-200 cursor-pointer"
                style={{ transformStyle: "preserve-3d" }}
              >
                {skill}
              </motion.span>
            ))}
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Skills;
